<p class="question"> 1.	How long will it take to get approval before we can start building a granny flat? </p>
<p> It usually takes approximately 6-8 weeks to gain Complying Development Approval. It is important to keep in mind that each property is different and in turn are assessed individually under the State Environmental Planning Policy, also known as the SEPP.</p>

<p class="question"> 2.	Do we have to gain approval from our local council to build a granny flat or can it be done through a private certifier? </p>
<p> Private certifiers have authority to assess and approve the construction of granny flats. The benefit of gaining approval through a private certifier is that the process is much quicker than submitting documents through a local council. Once your granny flat is approved, the documents are still sent over to your local council for their records. </p>

<p class="question">3.	What is a Private Certifier? </p>
<p> Private certifiers are qualified and professional entities that are entitled to issue approval and permits for construction proposals, either residential or commercial. </p>

<p class="question">4.	Do all councils in Sydney allow Granny flats? </p>
<p> Yes. However, you will need to check with your local council to see if there are any restrictions, which may prevent a granny flat being built on your block. This is usually highlighted in the 10.7 Planning certificate (formally known as a 149 Planning certificate) that can be purchased from your local council. This document can also be located in the contract of sale of the property. </p>

<p class="question"> 5.	Do I have to use a  standard design? </p>
<p> No. At Tekton we specialise in custom designed granny flats to suit your property, however we also have a few floor plan designs that you can select from. You will have the opportunity to sit with our design team to put together a concept. </p>

<p class="question"> 6.	What is the maximum size granny flat I can build?  </p>
<p> The maximum size for a granny flat, built as a secondary dwelling, is 60 m2. An attached garage with a roller door can also be constructed. </p>

<p class="question">  7. Are there any guidelines I need to meet when building a granny flat on my property? </p>
<p> Yes. All guidelines must comply with the current legislation which is called the Affordable Rental Housing State Environmental Planning Policy 2009, otherwise known as the ‘SEPP’. We can talk further about your property if we need to do a DA Approval.
If you comply under a CDC approval and your property is 450m2 the setbacks for a granny flat need to be:
</p>
<ul>
	<li> <b> 2 meters </b> from the rear fence </li>
	<li> <b> 0.9 meters </b> from the side fence </li>
</ul>
<p></p>

<p class="question"> 8.	Can I attach a granny flat to my house? </p>
<p> Yes. However, extra measures will need to be taken in consideration to ensure that proper fire-rated walls are built between the connecting walls. </p>

<p class="question"> 9.	Are there any hidden costs with Tekton Builders?</p>
<p> No. We pride ourselves on no hidden costs. We provide a fixed price quote after we have completed a free site inspection on your property. Any additional costs that are not included are specified in our tender. This is our guarantee to you. </p>
